    [],nt"revision_timestamp": "2015-08-21T22:46:59.393883",nt"name": "remote-order-entry-system-roes",nt"isopen":
    true,nt"url": null,nt"notes": "The Remote Order Entry System (ROES) is
    the front end of the Denver Acquisition & Logistics Center's (DALC) order fulfillment
    production system. ROES is used by VA and Department of Defense clinicians to place
    orders for certain types of medical products and services that are maintained under
    contract by the DALC. The most substantial product line handled through ROES is
    hearing aids. The ROES application and database are tailored for efficiency in ordering
    the specified devices and other items available from the DALC, and tracking them
    upon issue to an individual patient when appropriate. Other product lines handled
    through ROES include hearing aid accessories and batteries, cochlear implants, prosthetic
    items, aids for the visually impaired, and assistive devices. A line of service
    provided by the DALC and facilitated by ROES is that of hearing aid repair. The
    ROES application and database tie together the DALC enterprise business functions
    of contracting/acquisition management, order fulfillment, distribution management,
    finance, and product life cycle support. Extensive order tracking, serialized device
    registration, patient/device history, and sales/financial reporting are also supported
    by the database.",nt"license_title": "Creative Commons CCZero",nt"extras":
